/*Table structure for table `bml_category` */

DROP TABLE IF EXISTS `bml_category`;

CREATE TABLE `bml_category` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(40) DEFAULT NULL COMMENT '分类名',
  `parent_id` int DEFAULT NULL COMMENT '父节点ID',
  `order_by` tinyint DEFAULT '0' COMMENT '节点排列顺序',
  `deleted` int DEFAULT '0' COMMENT '逻辑删除 默认为0，1为已删除',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='分类信息表';

