/*Table structure for table `bml_work_content` */

DROP TABLE IF EXISTS `bml_work_content`;

CREATE TABLE `bml_work_content` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键',
  `work_id` bigint DEFAULT NULL COMMENT '关联职位ID',
  `deleted` int DEFAULT '0' COMMENT '逻辑删除 默认为0,1为删除',
  `company_description` text COMMENT '公司介绍',
  `create_time` datetime DEFAULT NULL COMMENT '职位添加时间',
  `update_time` datetime DEFAULT NULL COMMENT '职位更改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='职位文本表';

